import React, { Component } from "react";

const Checkout = () => {
  return (
    <div
      className="card my-5 mx-auto"
      style={{ width: "18rem", background: "#427D9D" }}
    >
      <div class="card-body">
        <h5 class="card-title">Thank You !</h5>
        <h6 class="card-subtitle mb-2 text-muted">Your order is Confirmed</h6>
        <p class="card-text"> </p>
      </div>
    </div>
  );
};

export default Checkout;
